import React, { Component } from "react";
import { Link } from "react-router-dom";

class UploadNavButtons extends Component {
  state = {};
  render() {
    return (
      <div id="uploadManualButtons">
        <Link>
          <span>Back</span>
        </Link>
        <span>Next</span>
      </div>
    );
  }
}

export default UploadNavButtons;
